 const [list, setList] = React.useState(['Nom', 'Post-nom', 'Prenom', 'Sexe']);

 return (
  <div className='wrp-list-title'>

   <ul>
    {[...list].map((index) => {

     <li>{index}</li>

    })}


    <li>Nom</li>
    <li>Post-nom</li>
